import styled from "styled-components";
const Container= styled.div`
width:100%;
height:100vh;
display:flex;
background-color: coral;

`
const Arrow=styled.div`
width:50px;
height:50px;
background-color:white;
border-radius:50%;
display:flex;
align-items:center;
justify-content:center;
`
const Slider = () => {
    return (
        <div>
            <Container>
<Arrow>
    <ArrowBackIosRounded/>
</Arrow>
<Arrow>
    <ArrowForwardIosRounded/>
</Arrow>
            </Container>
        </div>
    )
}

export default Slider
